import './App.css';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

// Import your page components

const JobsPage = lazy(() => import('./pages/JobsPage'))


function App() {
  return (
    <Router>
      <Routes>
          <Route path="/jobs" element={<JobsPage />} />
          {/* Add more routes as needed */}
      </Routes>


  </Router>




  );
}

export default App;
